import React from "react";

const Ntweet = ({ ntweetObj }) => {
  return (
    <div>
      <h4>{ntweetObj.text}</h4>
      {isOwner && (
        <>
          <button>Delete Ntweet</button>
          <button>Edit Ntweet</button>
        </>
      )}
    </div>
  );
};

export default Ntweet;
